import React, { Component } from "react";

export default class Planets extends Component {
  state = {
    hasErrors: false,
    planets: {},
  };

  componentDidMount() {
    fetch("https://github-dependents.glitch.me/facebook/react?limit=1")
      .then(response => response.json())
      .then(data => {
        let count = data.totalDependants;
        return (document.getElementById("response").innerHTML = count);
      });

    fetch("https://swapi.co/api/planets/4/")
      .then(res => res.json())
      .then(res => this.setState({ planets: res }))
      .catch(() => this.setState({ hasErrors: true }));
  }

  render() {
    return <div>{JSON.stringify(this.state.planets)}</div>;
  }
}
